// インタラクティビティの追加を学ぶ

// イベントハンドラにおいてpropsの読み取りを実施したいと思います。

function Button({onSmash,children}){
  return(
    <button onClick={onSmash}>
      {children}
    </button>
  );
}

function Toolbar({on削除,保存}){
  return(
    <div>
      <Button onSmash={削除}>削除</Button>
      <Button onSmash={保存}>保存</Button>
    </div>
  );
}

export default function App(){
  return (
  <div>
    <Toolbar 削除={()=>alert('削除されました')} 保存={()=>alert('保存されました')}/>

  </div>)
}
